import { Link } from "react-router-dom";
import "./Navbar.css";

const Navbar = () => {
  return (
    <div className="navbar-container">
      <Link to="/">home</Link>
      <Link to="/about">about</Link>
      <Link to="/mappage">map</Link>
    </div>
  );
};

export default Navbar;
